import * as React from "react";
import Card from "@mui/material/Card";
import CardHeader from "@mui/material/CardHeader";
import CardMedia from "@mui/material/CardMedia";
import CardContent from "@mui/material/CardContent";
import Typography from "@mui/material/Typography";
import Grid from "@mui/material/Grid"; // Import the Grid component
import moon from "./moon.png";
import land from "./land.png";

const cardStyle = {
    width: 300, // Set the width to your desired fixed width
    height: 400, // Set the height to your desired fixed height
  };

export default function Internship(props) {
  return (
    <Grid container spacing={2}> {/* Use a Grid container */}
      <Grid item xs={12} sm={12} md={6}> {/* Create a grid item for the first card */}
        <Card sx={cardStyle}>
          <CardHeader title= {props.title1}/>
          <CardMedia
            component="img"
            height="194"
            image={props.img1}
            alt={props.title1}
          />
          <CardContent>
            <Typography variant="body2" color="text.secondary">
            {props.body1}
            </Typography>
          </CardContent>
        </Card>
      </Grid>

      <Grid item xs={12} sm={12} md={6}> {/* Create a grid item for the second card */}
        <Card sx={cardStyle}>
          <CardHeader title={props.title2} /> {/* You can customize the second card similarly */}
          <CardMedia
            component="img"
            height="194"
            image={props.img2}
            alt={props.title2}
          />
          <CardContent>
            <Typography variant="body2" color="text.secondary">
            {props.body2}
            </Typography>
          </CardContent>
        </Card>
      </Grid>
    </Grid>
  );
}
